 INSERT INTO srdb.assessment VALUES('WGNSDS-WHITVIa-1984-2007-MINTO', 'WGNSDS', 'WHITVIa', 'MINTO', '2008-04-14', '2011-06-24 12:22:28', '1984-2007', 'http://www.ices.dk/products/CMdocs/CM-2007/CM2007.pdf', 'NULL', 'The assessment is solely based on surveys. Therefore the time series are presented in relative values, not absolute.', 'ICES-WGNSDS-2007.pdf', 1, 1, 'SURBA', 'The assessment is considered only to be indicative of stock trends. All time series are relative values (standardized between the surveys). Until revised Scottish discards are available and Irish discards included, an analytic assessment is not possible for this stock. The assessment presented by the WG this year is therefore based only on survey data which is the same approach as that adopted last year. Absolute reference points (provided in the assessment document) have been removed as they cannot be interpreted (ratios etc.) in the context of the current relative assessment', '../spreadsheets/MINTO-WHITVIa-2007-editedDR-QAQC.xls', '999') ; 
